CREATE TRIGGER `set_member_id_and_age` BEFORE INSERT ON `beneficiaries` FOR EACH ROW BEGIN
  DECLARE barangay_end_id VARCHAR(10);
  DECLARE household_seq VARCHAR(10);
  DECLARE member_number INT;
  DECLARE household_exists INT;
  
  -- Extract the last part of barangayID (e.g., "11" from "4110-11")
  SELECT SUBSTRING_INDEX(h.barangayID, '-', -1), 
         SUBSTRING_INDEX(h.householdID, '-', -1)
  INTO barangay_end_id, household_seq
  FROM household h 
  WHERE h.householdID = NEW.householdID;
  
  -- Check if household exists
  SELECT COUNT(*) INTO household_exists FROM household WHERE householdID = NEW.householdID;
  
  IF household_exists > 0 THEN
    -- Get the next member number for this household
    SELECT IFNULL(MAX(CAST(SUBSTRING_INDEX(memberID, '-', -1) AS UNSIGNED)), 0) + 1 INTO member_number
    FROM beneficiaries 
    WHERE householdID = NEW.householdID;
    
    -- Set the new memberID format: [BarangayEndID]-[HouseholdSequence]-[MemberNumber]
    SET NEW.memberID = CONCAT(
      barangay_end_id, '-',
      household_seq, '-',
      LPAD(member_number, 2, '0')
    );
  ELSE
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Household does not exist';
  END IF;
  
  -- Calculate age
  SET NEW.age = TIMESTAMPDIFF(YEAR, NEW.bday, CURDATE());
END
$$
